import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPhone, faInfo, faRightToBracket, faHouse } from '@fortawesome/free-solid-svg-icons';
import { faForumbee } from '@fortawesome/free-brands-svg-icons';
import './Navbar.css';

function Navbar() {
  const [activeTab, setActiveTab] = useState('anasayfa');

  return (
    <header className="header">
      <div className="logo">Beeonhive</div>
      <nav>
        <ul>
          <li className={activeTab === 'anasayfa' ? 'active' : ''} onClick={() => setActiveTab('anasayfa')}>
            <Link to="/"><FontAwesomeIcon icon={faHouse} className='icon-small' />Ana Sayfa</Link>
          </li>
          <li className={activeTab === 'urunler' ? 'active' : ''} onClick={() => setActiveTab('urunler')}>
            <Link to="/urunler"><FontAwesomeIcon icon={faForumbee} className='icon-small' />Ürünümüz</Link>
          </li>
          <li className={activeTab === 'hakkimizda' ? 'active' : ''} onClick={() => setActiveTab('hakkimizda')}>
            <Link to="/hakkimizda"><FontAwesomeIcon icon={faInfo} className="icon-small" /> Hakkımızda</Link>
          </li>
          <li className={activeTab === 'iletisim' ? 'active' : ''} onClick={() => setActiveTab('iletisim')}>
            <Link to="/iletisim"><FontAwesomeIcon icon={faPhone} className="icon-small" /> İletişim</Link>
          </li>
          <li className={activeTab === 'giris' ? 'active' : ''} onClick={() => setActiveTab('giris')}>
            <Link to="/giris-yap"><FontAwesomeIcon icon={faRightToBracket} className="icon-small" />Giriş Yap</Link>
          </li>
        </ul>
      </nav>
    </header>
  );
}

export default Navbar;
